svg.script:
nv.addGraph(function() {
  var chart = nv.models.pieChart()
      .x(function(d) { return d.label })
      .y(function(d) { return d.value })
      .showLabels(true);


    d3.select("#pie")
        .datum(memberData())
      .transition().duration(1200)
        .call(chart);

  sozi.events.listen("sozi.player.framechange", function(i) {
    chart.update();
  });

  return chart;
});

function memberData() {
  return [
  {
    key: "BSUG Members",
    values: [
      { 
        "label" : "Bath" ,
        "value" : 74
      } , 
      { 
        "label" : "Bristol" , 
        "value" : 22
      } , 
      { 
        "label" : "London" , 
        "value" : 8
      } ,
      { 
        "label" : "Birmingham" , 
        "value" : 2
      } ,  
     { 
        "label" : "Trowbridge" , 
        "value" : 2
      } ,  
      { 
        "label" : "Other" , 
        "value" : 28
      } 
    ]
  }
  ];
}

d3.json("cfd.json", function (data) { 

nv.addGraph(function() {
 var chart = nv.models.stackedAreaChart()
  .x(function(d) { return d[0] })
  .y(function(d) { return d[1] })
  .clipEdge(true);

chart.xAxis
  .tickFormat(function(d) { return d3.time.format('%x')(new Date((d - (25567 + 1))*86400*1000)) });

chart.yAxis
  .tickFormat(d3.format(',.0f'));

d3.select('#cfd')
  .datum(data)
  .transition().duration(500).call(chart);

  sozi.events.listen("sozi.player.framechange", function(i) {
    setTimeout(function() {
      chart.update();
    }, 5000);
  });

return chart;
});

});
